import React, { useState } from 'react';
import styled from 'styled-components';
import * as dateFns from 'date-fns';
import { breakpoints } from 'styled-bootstrap-responsive-breakpoints';
import { Tab, Row, Col, ListGroup } from 'react-bootstrap';


const Styles = styled.div`

`

export default function Hours() {

    const hourRanges = ["9.00 - 9.30", "9.30 - 10.00", "10.00 - 10.30", "10.30 - 11.00", "11.00 - 11.30",
     "11.30 - 12.00", "12.00 - 12.30", "12.30 - 13.00", "13.00 - 13.30", "13.30 - 14.00", "14.00 - 14.30",
      "14.30 - 15.00", "15.00 - 15.30", "15.30 - 16.00", "16.00 - 16.30", "16.30 - 17.00", "17.00 - 17.30"];
    
    const hoursTable = [];

    hoursTable = hourRanges.forEach((item) => {
            <ListGroup.Item action href="">
                {item}
            </ListGroup.Item>
    });


    // function fillHours() {
    //     for (let i = 0; i < hourRanges.length; i++) {
    //         hoursTable.push(
    //         <ListGroup.Item action href="">
    //             {hourRanges[i]}
    //         </ListGroup.Item>
    //         )
    //     }
    // }

    return (
        <Styles className="" >
            <Tab.Container id="list-group-tabs-example" defaultActiveKey="#link1">
                <Row>
                    <Col sm={4}>
                        <ListGroup>
                            {hoursTable}
                        </ListGroup>
                    </Col>
                    <Col sm={8}>
                        <Tab.Content>
                            <Tab.Pane eventKey="#link1">
                                <p>Oto okienko 1</p>
                            </Tab.Pane>
                            <Tab.Pane eventKey="#link2">
                                <p>Oto okienko 2</p>
                            </Tab.Pane>
                        </Tab.Content>
                    </Col>
                </Row>
            </Tab.Container>
        </Styles>
    );
}
